I'm long AMC but on shares. Most of the big movies are in back half of 2019 and I think the balance sheet and upcoming "growth" (i.e. spending shitload of money) is keeping the stock down. I'd rather pick up a 7% dividend while bagholding a year than lose my edge seeing my options expire. (I had a post on this a couple months ago and said long AMC, but on shares.) 

&amp;#x200B;

OP - If I were you and you want to make a pure summer movie bet and Avengers $$$$ bet, I'd bet $CNK (Cinemark). If you think A-List (stubs) program is going to come to fruition and translate to meaningufl earnings, I would agree with you, however I think your expiry isn't far out enough. GL

The problem is that the movie business is distressed and investors know that 2020 will be nightmarish for movie theaters given that Disney pulled forward a ton of movies to 2019 for Disney+.

&amp;#x200B;

The movie business could face steep decline in the next couple of years and AMC has tons of debt on its books.

